class Solution
{
	public:
	void permute(int l,string &s,set<string> &ans)
	{
	    if(l==s.size())
	    {
	        ans.insert(s);
	        return;
	    }
	    for(int i=l;i<s.size();i++)
	    {
	        swap(s[i],s[l]);
	        permute(l+1,s,ans);
	        swap(s[i],s[l]);
	    }
	}
		vector<string>find_permutation(string S)
		{
		  set<string> ans;
		  sort(S.begin(),S.end());
		  permute(0,S,ans);
		  vector<string> res(ans.begin(),ans.end());
		  return res;
		}
};



