    vector<int> z(s.size());
    int first = 0;
    int last = 1;
    for (int i = 1; i < s.size(); ++i){
        if (i >= first && i < last && z[i - first] + i < last){
            z[i] = z[i - first];
        } else {
            z[i] = max(0, last - i);
            first = i;
            while (s[i + z[i]] == s[z[i]] && i + z[i] < s.size()){
                ++z[i];
            }
            last = i + z[i];
        }
    }
    return z;
}

